import React from 'react'
import Movies from './Movies';

const cont = () => {
    function formSub()
    {
        let Name = document.getElementById("Name").value;
        alert(Name);
    }
  return (
    <div>
        <form className='NameForm'>
            <label>Name: </label>
            <input className='Name' id='Name' type="text"></input>
            <button type='button' onClick={formSub}>Submit</button>
        </form>
        <Movies name={Name}/>
    </div>
  )
}


export default cont
